import React from 'react'

const Pods = ({pods}) => {  
return (
    <div>
      <center><h1>Pod List</h1></center>
      {pods.map((pod) => {
        let podName = pod.metadata.name
        let podStatus = pod.status.phase
        return <div>
            <h5>{podName}</h5>
            <h5>{podStatus}</h5>
        </div>
      })}

    </div>
  )
};

export default Pods
